import React, { useContext } from 'react'
import { AuthContext } from '../context/authContext'

export default function ProfilPage() {
    const {currentUser} = useContext(AuthContext)

  return (
    <div className='w-screen min-h-screen bg-[#f9fafb] flex flex-col justify-center items-center'>
        <div className='w-[90%] min-h-screen flex flex-col pt-5 items-center'>
        <img
                src={currentUser.img}
                alt="Team Member"
                className="w-25 h-25 mx-auto rounded-full mb-4"
              />
              <h1 className=''>{currentUser.username}</h1>
        </div>
    </div>
  )
}
